const Main = () => {
    return(
        <Background>
            <Container>

                <div class ='line_one'>
                    <div class ='div-one'>Rodizio</div>
                    <div class = 'div-two'>Happy Hour</div>
                </div>
                <div class ='line_two'>
                    <div class = 'div-three'> Terça em Dobro </div>
                    <div class = 'div-four'> Chopps </div>
                </div>
                <div class ='line_three'>
                    <div class = 'div-five'> Terça em Dobro </div>
                    <div class = 'div-six'> Chopps </div>
                </div>

            </Container>  
        </Background>
    );
}

export default Main;
